import React from "react";
import './Home.css';
import SettingsIcon from '@mui/icons-material/Settings';
const Header = () => {
  return (
    <>
      <section>
        <div className="container">
          <div className="row">
            <h1>About Us</h1>
            <p>
              For 25 years, Air Care, Heating & Air Conditioning Expert has
              remained a true family owned and operated residential and light
              commercial HVAC company.
            </p>
            <div className="col-lg-6 col-md-6 col-12">
              <div className="">
                <img src="../images/header.jpg" className="img-thumbnail" alt="" />
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};

export default Header;
